        <!-- ======= Contact Section ======= -->
        <section style="padding: 20px 0" id="contact" class="contact">
            <div class="container">

                <div class="section-title">
                    <span>Контакты</span>
                    <h2>Контакты</h2>
                    <p>У Вас остались вопросы или Вы хотите оставить отзыв? Заполните форму и мы свяжемся с Вами в ближайшее время!</p>
                </div>

                <div class="row">

                    <div class="col-lg-5 d-flex align-items-stretch">
                        @if(count($contact)>0)
                            <div class="info">
                            @foreach($contact as $item)
                                @if($item->address)
                            <div class="address">
                                <i class="icofont-google-map"></i>
                                <h4>Адрес:</h4>
                                <p>{{$item->address}}</p>
                            </div>
                                    @endif
                            @if($item->phone)
                            <div class="phone">
                                <i class="icofont-phone"></i>
                                <h4>Номер:</h4>
                                <p>{{$item->phone}}</p>
                            </div>
                            @endif
                            @endforeach
                                    <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2503.78404127632!2d71.42146741575611!3d51.13089137957511!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x42458713a6ad47d5%3A0x51b4bb921db67e09!2z0JHQpiBFbWVyYWxkIFRvd2Vy!5e0!3m2!1sru!2skz!4v1601745049356!5m2!1sru!2skz" style="border:0; width: 100%; height: 290px;" frameborder="0" style="border:0;" allowfullscreen="" aria-hidden="false" tabindex="0"></iframe>
                        </div>
                        @endif



                    </div>

                    <div class="col-lg-7 mt-5 mt-lg-0 d-flex align-items-stretch">
                        <form action="sendmail" method="post" class="contact-send">

                            <div class="form-row">
                                <div class="form-group col-md-6">
                                    <label for="company">Компания</label>
                                    <input type="text" class="form-control" required name="company" id="company" />
                                </div>
                                <div class="form-group col-md-6">
                                    <label for="name">ФИО</label>
                                    <input type="text" name="name" required class="form-control" id="name" />
                                </div>
                                <div class="form-group col-md-6">
                                    <label for="subject">Телефон</label>
                                    <input data-inputmask="'mask': '8(799)-999-99-99'" type="text" class="form-control" required name="phone" id="subject" />
                                </div>
                                <div class="form-group col-md-6">
                                    <label for="email">Email</label>
                                    <input type="email" class="form-control" required name="email" id="email" />
                                </div>
                            </div>

                            <div class="form-group">
                                <label for="message">Сообщение</label>
                                <textarea class="form-control" id="message" name="message" rows="10" ></textarea>

                            </div>
                            <div class="text-center"><button style="background-color: #FFBF75;" id="button" class="btn btn-warning" type="submit">Отправить</button></div>
                        </form>
                    </div>

                </div>

            </div>
        </section><!-- End Contact Section -->

    </main><!-- End #main -->





